import { Modal, ModalHeader, ModalBody, ModalFooter, Spinner,TabContent, TabPane, Nav, NavItem, NavLink, Card, Button, CardTitle, CardText, Row, Col } from 'reactstrap';
import React, {useState} from 'react';
import classnames from 'classnames';
class Diagnosis extends React.Component{
	constructor(props){
		super(props);
		this.state = {
		}

	}

	render(){
		return(
			<div>
				{this.props.currentState.showModalDiagnosis && <ModalDiagnosis handlerSuper={()=>{this.props.handler("OnConnection")}}/>}
			</div>
		);
	}
}

const ModalDiagnosis= (props) => {
  const {
    className
  } = props;

  const [modal, setModal] = useState(true);

  const toggle = () => {
  	setModal(!modal);
		props.handlerSuper();
	}
  return (
    <div>
      <Modal isOpen={modal} toggle={toggle} className={className} size={'xl'}>
        <ModalBody>
					<Example/>
					<Spinner color="info" style={{ position: 'absolute',margin: 'auto' }} size={'xl'}/>
        </ModalBody>
      </Modal>
    </div>
  );
}
const Example = (props) => {
  const [activeTab, setActiveTab] = useState('1');

  const toggle2 = tab => {
    if(activeTab !== tab) setActiveTab(tab);
  }

  return (
    <div>
      <Nav tabs>
        <NavItem>
          <NavLink
            className={classnames({ active: activeTab === '1' })}
            onClick={() => { toggle2('1'); }}>
            Diagnostico
          </NavLink>
        </NavItem>

        <NavItem>
          <NavLink
            className={classnames({ active: activeTab === '2' })}
            onClick={() => { toggle2('2'); }}
          >
            Descargas
          </NavLink>
        </NavItem>
      </Nav>

      <TabContent activeTab={activeTab}>
        <TabPane tabId="1">
          <Row>
            <Col sm="12">
              <h4>Tab 1 Contents</h4>
            </Col>
          </Row>
        </TabPane>
        <TabPane tabId="2">
          <Row>
          </Row>
        </TabPane>
      </TabContent>
    </div>
  );
}
export default Diagnosis;
